import React, { Component , useState ,useRef } from "react";
import image from "../assets/loqow.png";
import "./Footer.scss";
import $ from 'jquery';
import { NavLink, withRouter } from "react-router-dom";
const Footer = () => {
$("#search_submit").on("click", function () {
    //var search_str = jQuery("#search_text").val();console.log(search_str);
    findString('');
    return false;
})

var TRange=null;

function findString (str) {
    $("#search_text").val();
    if (parseInt(navigator.appVersion)<4) return;
    var strFound;
    if (window.find) {

        // CODE FOR BROWSERS THAT SUPPORT window.find

        var original_content = window;
        strFound=original_content.find(str);
        if (!strFound) {
            strFound=original_content.find(str,0,1);
            while (original_content.find(str,0,1)) continue;
        }
    }
    else if (navigator.appName.indexOf("Microsoft")!=-1) {

        // EXPLORER-SPECIFIC CODE

        if (TRange!=null) {
            TRange.collapse(false);
            strFound=TRange.findText(str);
            if (strFound) TRange.select();
        }
        if (TRange==null || strFound==0) {
            TRange=self.document.body.createTextRange();
            strFound=TRange.findText(str);
            if (strFound) TRange.select();
        }
    }
    else if (navigator.appName=="Opera") {
        alert ("Opera browsers not supported, sorry...")
        return;
    }
    if (!strFound) alert ("String '"+str+"' not found!")
    return;
}

    return (
      <div className="footer">
        <div className="main">
          <div className="child-one">
            <img src={image} />
            <p>Tel: +994 12 430 49 93</p>
            <p className="line-more">Mail: info@hacklab.az</p>
            <p className="line-less">
              Ünvan: Bakı şəhəri, Atatürk pr. 30A
            </p>
            <span className="right">2021. Bütün hüquqlar qorunur.</span>
          </div>
          <div className="child-two">
            <p className="facebook">
              <a href="https://www.facebook.com/hacklabaz">Facebook</a>
            </p>
            <p className="instagram">
              <a href="https://www.instagram.com/hacklabaz/">Instagram</a>
            </p>
            <p className="linkedin">
              <a href="https://www.linkedin.com/company/hacklabaz">Linkedin</a>
            </p>
          </div>
          <div className="child-three">
            <div className="two-two">
              <a href="/" className="home-hov">Ana səhifə</a>
              <a href="#up" className="up">
                Yuxarı qayıt
              </a>
            </div>
            {/* <p>
              <a className="layiheler">Layihələr </a>
            </p> */}
            <p>
              <a href="/faq" className="faq-hover">FAQ</a>
            </p>
            <div className="search-icon">
              <input type="text" id="search_text" placeholder="Axtar" />
              <div class="fa-search1">
                <img src="https://i.ibb.co/Yjc7Q3K/Whats-App-Image-2021-10-29-at-14-25-33-removebg-preview.png" />
              </div>
              {/* <i class="fas fa-search">f</i> */}
            </div>
            <div className="end">site by: ZOOM Agency</div>
          </div>
        </div>
      </div>
    );
  
}



export default Footer
